SET statement_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
CREATE SCHEMA obj;
COMMENT ON SCHEMA obj IS 'Объекты системы.
Документы, справочники, журналы, отчёты длительного хранения.';
SET search_path = obj, pg_catalog;
CREATE FUNCTION otable_fill(_uuid uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$declare
	_stmt	text;
begin
	select 'INSERT INTO ' || def.otablename(tp) 
	|| ' ("uuid", ' 
	|| array_to_string(array_agg('"'||p::text||'"'), ', ') 
	|| ') values (' 
	|| quote_literal(uuid::text) || '::uuid , '
	|| array_to_string(array_agg(quote_literal(d)||'::'||t), ', ') 
	|| ')'
	into _stmt
	from (
		select o.type tp, r.uuid uuid, r.path  as p, r.data d, t.db_type t
			from  obj.requisites r, obj.user_raw o, def.requisites d, def.types t
			where nlevel(r.path) =1
			and o.uuid = r.uuid and d.parent = o.type and d.code = r.path and t.code = d.type
			and o.uuid = _uuid
			) q1
	group by uuid, tp;
	if (_stmt is null) then exit; end if;
	begin
		execute _stmt;
	end;
end;$$;
SET default_tablespace = '';
SET default_with_oids = false;
CREATE TABLE n_dic_account (
    uuid uuid DEFAULT tools.uuid_generate_v4() NOT NULL,
    num text,
    bank uuid,
    agent uuid[],
    period daterange[]
);
CREATE TABLE n_dic_agent (
    uuid uuid DEFAULT tools.uuid_generate_v4() NOT NULL,
    code text,
    fullname text,
    inn integer,
    kpp integer,
    shortname text
);
CREATE TABLE n_dic_bank (
    uuid uuid DEFAULT tools.uuid_generate_v4() NOT NULL,
    name text,
    bic integer,
    account integer
);
CREATE TABLE n_doc_pay (
    uuid uuid DEFAULT tools.uuid_generate_v4() NOT NULL,
    nds_sm numeric,
    nds_rate numeric,
    num text,
    date date,
    sm numeric,
    note text,
    sender uuid,
    reciever uuid
);
CREATE VIEW otables AS
    SELECT pg_tables.schemaname, pg_tables.tablename FROM pg_tables WHERE ((pg_tables.schemaname = 'obj'::name) AND (pg_tables.tablename ~~ 'n_%'::text));
COMMENT ON VIEW otables IS 'Список таблиц с нормализованными данными';
CREATE TABLE raw (
    uuid uuid DEFAULT tools.uuid_generate_v4() NOT NULL,
    comp uuid DEFAULT set.company_get() NOT NULL,
    data json,
    type ext.ltree NOT NULL
);
COMMENT ON TABLE raw IS 'Ненормализованные данные';
COMMENT ON COLUMN raw.uuid IS 'Идентификатор объекта';
COMMENT ON COLUMN raw.comp IS 'Организация';
COMMENT ON COLUMN raw.data IS 'Содержимое объекта';
COMMENT ON COLUMN raw.type IS 'Тип объекта';
CREATE VIEW user_raw AS
    SELECT raw.uuid, raw.type, raw.data FROM raw WHERE (raw.comp = set.company_get());
COMMENT ON VIEW user_raw IS 'Объекты, доступные пользователю';
CREATE VIEW requisites AS
    SELECT q1.uuid, ("substring"(q1.a[1], 3))::ext.ltree AS path, q1.a[2] AS data FROM (SELECT o1.uuid, json.parse(o1.data) AS a FROM user_raw o1) q1;
COMMENT ON VIEW requisites IS 'Реквизиты объектов';
ALTER TABLE ONLY n_dic_account
    ADD CONSTRAINT pk_n_dic_account PRIMARY KEY (uuid);
ALTER TABLE ONLY n_dic_agent
    ADD CONSTRAINT pk_n_dic_agent PRIMARY KEY (uuid);
ALTER TABLE ONLY n_dic_bank
    ADD CONSTRAINT pk_n_dic_bank PRIMARY KEY (uuid);
ALTER TABLE ONLY n_doc_pay
    ADD CONSTRAINT pk_n_doc_pay PRIMARY KEY (uuid);
ALTER TABLE ONLY raw
    ADD CONSTRAINT pk_raw PRIMARY KEY (uuid);
CREATE INDEX fki_raw_type ON raw USING btree (type);
ALTER TABLE ONLY raw
    ADD CONSTRAINT fk_raw_type FOREIGN KEY (type) REFERENCES def.types(code) ON UPDATE CASCADE ON DELETE SET NULL;
